import React from "react";
import TodoItem from "./TodoItem";

const TodoList = ({ todos, toggleComplete, removeTodo, updateDueDate }) => {
  return (
    <ul>
      {todos.map((todo) => (
        <TodoItem
          key={todo.id}
          todo={todo}
          toggleComplete={toggleComplete}
          removeTodo={removeTodo}
          updateDueDate={updateDueDate} // Make sure you pass the prop here
        />
      ))}
    </ul>
  );
};


export default TodoList;
